    List<CustomersPerCountry> customers;

    protected override void OnInitialized()
    {
        base.OnInitialized();
        GetCustomers();
    }

    void GetCustomers()
    {
        customers = context.Customers
            .GroupBy(c => c.StateProvince)
            .Select(c => new CustomersPerCountry
            {
                Country = c.Key,
                Count = c.Count()
            }).ToList();

    }

